import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Login extends Component{
    render(){
        return(
            <div>
                <h1>This is login Component!</h1>
                <Link to="/signup">Click to signup</Link>
            </div>
        )
    }
}
